INSERT INTO `v1_9e81d7ef925ce85614e223d86121265b1902643990c17d562dbb935a44e0941b` VALUES (1, 0, 1110501, 1110501043, 111011, 4, 0, "", 1, "この蝋燭は、もしや君が作ったのか？\nなに、精油にそんな希少な成分を？\nわざわざぼくの誕生日を祝うために？\n後輩……君という子は……！", 11);
INSERT INTO `v1_9e81d7ef925ce85614e223d86121265b1902643990c17d562dbb935a44e0941b` VALUES ("", "", 1110501, 1110501044, 0, "", "", "", "", "", 91);
INSERT INTO `v1_9e81d7ef925ce85614e223d86121265b1902643990c17d562dbb935a44e0941b` VALUES (0, "", 1110501, 1110501045, "vo_adv_1110501", 0, "", "", "", "vo_adv_1110501_002", 21);
INSERT INTO `v1_9e81d7ef925ce85614e223d86121265b1902643990c17d562dbb935a44e0941b` VALUES (1, 0, 1110501, 1110501046, 111011, 4, 0, "", 1, "しかし蝋燭はいいが、この土台部分──\nいや、バースデーケーキとかいう祝祭の\n文化か。ううむ気持ちは有難いが、\n食の細いぼくには若干拷問サイズだ……", 11);
INSERT INTO `v1_9e81d7ef925ce85614e223d86121265b1902643990c17d562dbb935a44e0941b` VALUES ("", "", 1110501, 1110501047, 0, "", "", "", "", "", 91);
INSERT INTO `v1_9e81d7ef925ce85614e223d86121265b1902643990c17d562dbb935a44e0941b` VALUES (0, "", 1110501, 1110501048, "vo_adv_1110501", 0, "", "", "", "vo_adv_1110501_003", 21);
INSERT INTO `v1_9e81d7ef925ce85614e223d86121265b1902643990c17d562dbb935a44e0941b` VALUES (1, 0, 1110501, 1110501049, 111011, 5, 0, "", 1, "ややっ？　よくよく見ればこの土台、\nケーキなのはほんの一部分だけで、\n大半はよく出来た模造品じゃあないか！\nな、なんと配慮の行き届いた……！", 11);
INSERT INTO `v1_9e81d7ef925ce85614e223d86121265b1902643990c17d562dbb935a44e0941b` VALUES ("", "", 1110501, 1110501050, 0, "", "", "", "", "", 91);
